// import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react'
import { getTests, getTest, createTests, updateTests, deleteTests } from './api';
import { post } from '../../backend/testingRoutes';

function App() {

  const [data, setData] = useState()

    function createUser() {
      let postObject = {
        name: "Katie Dinh",
        email: "ikatiedinh@gmail.com",
        text: "oh god",
        date: new Date()
      }

      createUser(postObject)
    }
  /*useEffect(() => {
    async function loadAllTests() {
      let data = await getTests()
      if (data) {
        setData(data)
      }
    }

    loadAllTests()
  }, [])*/ //Empty dependency array means this only runs on first launch.
  return (
    <>
      {JSON.stringify(data)}
    </>
  );
}

export default App;
